    <script>
    function enableLocationTracking(map) {
        map.locate({setView: true, watch: true, enableHighAccuracy: true});

        function onLocationFound(e) {
            var radius = e.accuracy / 2;

            if (typeof userMarker === "undefined") {
                userMarker = L.marker(e.latlng, {
                    icon: L.icon({
                        iconUrl: 'https://leafletjs.com/examples/custom-icons/leaf-blue.png',
                        iconSize: [20, 20],
                        iconAnchor: [10, 10]
                    })
                }).addTo(map);
            } else {
                userMarker.setLatLng(e.latlng);
            }

            if (typeof userCircle === "undefined") {
                userCircle = L.circle(e.latlng, {radius: radius, color: 'blue', fillOpacity: 0.2}).addTo(map);
            } else {
                userCircle.setLatLng(e.latlng);
                userCircle.setRadius(radius);
            }
        }

        function onLocationError(e) {
            alert("Location access denied or unavailable.");
        }

        map.on('locationfound', onLocationFound);
        map.on('locationerror', onLocationError);
    }

    document.addEventListener("DOMContentLoaded", function() {
        enableLocationTracking(map);
    });
    </script>
